import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
      <div><Header /></div>
      <div className="App">
      Simple Text
      </div>
    </div>
  );
}

const Header = () => {
    return (
     <div>
        <a>Second</a>
    </div>
);
}

export default App;
